import React from "react";

import TodoListItem from "./todo-list-item";

const TodoList = ({ todos }) => {

    const elemetns = todos.map((item) => {
        return (
            <li>
                <TodoListItem
                    label={item.label}
                    important={item.important} />
            </li>
        );
    });

    return(
        <ul>
            { elemetns }
        </ul>
    );
};

export default TodoList;
